
public class hash_code_for_strings {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s111 = "qwerty";
		String s222 = "zxcvb";
		int z11 = s111.hashCode();
		int z22 = s222.hashCode();
		System.out.println(z11);
		System.out.println(z22);

	}

}
